import React from 'react';
import './App.css';
import Gifticon from './components/Gifticon';

const gifticon = [{
  'id' : 1,
  'image' : 'https://placeimg.com/64/64/1',
  'name' : '스타벅스',
  'exp_date' : '20200820',
  'used' : 'false'
},
{
  'id' : 2,
  'image' : 'https://placeimg.com/64/64/2',
  'name' : '할리스',
  'exp_date' : '20200819',
  'used' : 'true'
},
{
  'id' : 3,
  'image' : 'https://placeimg.com/64/64/3',
  'name' : '커피빈',
  'exp_date' : '20200818',
  'used' : 'true'
}]

function App() {
  return (
    <div>
      <Gifticon
        id = {gifticon[0].id}
        gifticonimg = {gifticon[0].gifticonimg}
        name = {gifticon[0].name}
        exp_date = {gifticon[0].exp_date}
        used = {gifticon[0].used}
      />
      <Gifticon
        id = {gifticon[1].id}
        gifticonimg = {gifticon[1].gifticonimg}
        name = {gifticon[1].name}
        exp_date = {gifticon[1].exp_date}
        used = {gifticon[1].used}
      />
      <Gifticon
        id = {gifticon[2].id}
        gifticonimg = {gifticon[2].gifticonimg}
        name = {gifticon[2].name}
        exp_date = {gifticon[2].exp_date}
        used = {gifticon[2].used}
      />
    </div>
  );
}
export default App;
